import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import Login from '../src/Login/Login';
import Fstpage from '../src/ftpage/Fstpage';
import Navbar from './Navbar/Navbar';
import Signup from './signuppage/Signup';
import Forget from './forgetpassword/Forget';
import ServiceHelp from "./service/ServiceHelp";
import Abtpage from "./Aboutpage/Abtpage";
import Contact from "./contact/Contact";

function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
        <Route path='/navbar'
        element={
          <>
          <Navbar/>
          </>
        }/>

<Route path='learn'
        element={
          <>
          <Navbar/>
          <Fstpage/>
          </>
        }/>

<Route path='abt-page'
        element={
          <>
          <Navbar/>
          <Abtpage/>
          </>
        }/>

<Route path='cnt-page'
        element={
          <>
          <Navbar/>
          <Contact/>
          </>
        }/>

<Route path='Login'
        element={
          <>
          <Navbar/>
          <Login/>
          </>
        }/>

<Route path='Signup'
        element={
          <>
          <Navbar/>
          <Signup/>
          </>
        }/>
        <Route path='Forget'
        element={
          <>
          <Navbar/>
          <Forget/>
          </>
        }/>
         <Route path='help-line'
        element={
          <>
          <Navbar/>
          <ServiceHelp/>
          </>
        }/>
           <Route path='foot-p'
        element={
          <>
          <Navbar/>
          <ServiceHelp/>
          </>
        }/>

      </Routes>
      </Router>
    </div>
  );
}

export default App;
